"""# Student TODO implementation 1: Fitting a single image with positional encoding

## TODO 1(a): Positional encoding
In class, we learned that standard coordinate-based MLPs cannot natively represent high-frequency functions on low-dimensional domains.
To better preserve high frequency variation in the data, we can encode each of the scalar input coordinates with a sequence of sinusoids with exponentially increasing frequencies before passing them into the network.

Given a coordinate $ùê±$, we map each coordiante value $p$ in $ùê±$ with the encoding function $\gamma(‚ãÖ)$ as below:
$$Œ≥(p)=(\text{sin}(2^0œÄp), \text{cos}(2^0œÄp), \text{sin}(2^1œÄp), \text{cos}(2^1œÄp), \cdots, \text{sin}(2^{L-2}œÄp), \text{cos}(2^{L-2}œÄp), \text{sin}(2^{L-1}œÄp), \text{cos}(2^{L-1}œÄp))$$
where the dimension of the output $Œ≥(p)$ is $2L$.

If the input is a 2D coordinate $ùê±=(p_1,p_2)$, after positional encoding we will get a long vector with dimension $4L$:
$$(\text{sin}(2^0œÄp_1), \text{sin}(2^0œÄp_2), \text{cos}(2^0œÄp_1), \text{cos}(2^0œÄp_2), \text{sin}(2^1œÄp_1), \text{sin}(2^1œÄp_2), \text{cos}(2^1œÄp_1), \text{cos}(2^1œÄp_2), \cdots, \text{sin}(2^{L-2}œÄp_1), \text{sin}(2^{L-2}œÄp_2), \text{cos}(2^{L-2}œÄp_1), \text{cos}(2^{L-2}œÄp_2), \text{sin}(2^{L-1}œÄp_1), \text{sin}(2^{L-1}œÄp_2), \text{cos}(2^{L-1}œÄp_1), \text{cos}(2^{L-1}œÄp_2))$$

Similarly you can encode a 3D coordinate or an input signal of any dimension.
"""

def positional_encoding(x, num_frequencies=6, incl_input=True):
  r"""Apply positional encoding to the input.

  Args:
    x (torch.Tensor): Input tensor to be positionally encoded.
      The dimension of x is [N, D], where N is the number of input coordinates,
      and D is the dimension of the input coordinate.
    num_frequencies (optional, int): The number of frequencies used in
     the positional encoding default: 6).
    incl_input (optional, bool): If True, concatenate the input with the
        computed positional encoding (default: True).

  Returns:
    (torch.Tensor): Positional encoding of the input tensor.
  """
  results = []
  if incl_input:
    results.append(x)
  #############################  TODO 1(a) BEGIN  ############################
  # encode input tensor and append the encoded tensor to the list of results.
  for i in range(num_frequencies):
      freq = 2 ** i
      sin_enc = torch.sin(freq * np.pi * x)
      cos_enc = torch.cos(freq * np.pi * x)
      results.append(sin_enc)
      results.append(cos_enc)

  #############################  TODO 1(a) END  ##############################
  return torch.cat(results, dim=-1)

