"""## TODO 3: Sample the 3D points on the camera rays.

Given the origin $ùê®$ and the direction $ùêù$ of a ray, we want to sample 3D points $ùê±$ on this ray. The sampling range is bounded by the near and far threshold, denoted as $t_n, t_f$. In order to ensure the ray to be thoroughly sampled during training, we evenly partition the ray into $N$ bins and uniformly sample one point in each bin.

$$ùê±_i=ùê® + t_iùêù$$
$$t_i ‚àº ùëº[t_n+\frac{i-1}{N}(t_f-t_n), t_n+\frac{i}{N}(t_f-t_n)]$$

where $t_i, i=\{1,\cdots,N\}$ is the sampled depth value.

In the function of `sample_points_from_rays`, there is an argument called `randomize`. When `randomize` is `True`, you should sample one point uniformly at random from each bin.
When `randomize` is `False`, you should instead sample the lower bound of each bin, i.e.,
$$t_i = t_n+\frac{i-1}{N}(t_f-t_n)$$
"""

def sample_points_from_rays(
    ray_origins,
    ray_directions,
    near_thresh,
    far_thresh,
    num_samples,
    randomize = True
):
  r"""Sample 3D points on the given rays. The near_thresh and far_thresh
  variables indicate the bounds of sampling range.

  Args:
    ray_origins (torch.Tensor): Origin of each ray in the "bundle" as returned by the
      `get_rays` method (shape: :math:`(height, width, 3)`).
    ray_directions (torch.Tensor): Direction of each ray in the "bundle" as returned by the
      `get_rays` method (shape: :math:`(height, width, 3)`).
    near_thresh (float): The 'near' extent of the bounding volume (i.e., the nearest depth
      coordinate that is of interest/relevance).
    far_thresh (float): The 'far' extent of the bounding volume (i.e., the farthest depth
      coordinate that is of interest/relevance).
    num_samples (int): Number of samples to be drawn along each ray. Samples are drawn
      randomly, whilst trying to ensure "some form of" uniform spacing among them.
    randomize (optional, bool): Whether or not to randomize the sampling of query points.
      By default, this is set to `True`. If disabled (by setting to `False`), we sample
      uniformly spaced points along each ray (i.e., the lower bound of each bin).

  Returns:
    query_points (torch.Tensor): Query 3D points along each ray
      (shape: :math:`(height, width, num_samples, 3)`).
    depth_values (torch.Tensor): Sampled depth values along each ray
      (shape: :math:`(height, width, num_samples)`).
  """
  device = ray_origins.device
  height, width = ray_origins.shape[:2]
  depth_values = torch.zeros((height, width, num_samples), device=device) # placeholder
  query_points = torch.zeros((height, width, num_samples, 3), device=device) # placeholder
  #############################  TODO 3 BEGIN  ##########################

  num_samples_per_ray = num_samples
  depth_range = far_thresh - near_thresh
  near_bound = near_thresh

  # Sample uniformly spaced points along each ray
  # The sampled depths are calculated by dividing the depth range into equal intervals
  if not randomize:
      sampled_depths = near_bound + torch.arange(num_samples_per_ray) * depth_range / num_samples_per_ray

  # Sample randomly within each depth bin along each ray
  # The depth range is divided into bins, and random offsets are used to sample within each bin
  else:
      bin_starts = near_bound + torch.arange(num_samples_per_ray) * depth_range / num_samples_per_ray
      bin_ends = near_bound + torch.arange(1, num_samples_per_ray + 1) * depth_range / num_samples_per_ray

      random_offsets = torch.rand(num_samples_per_ray)
      sampled_depths = (bin_starts - bin_ends) * random_offsets + bin_ends

  # Expand the sampled depths to match the shape of ray origins and directions
  depth_values = sampled_depths.expand(height, width, num_samples_per_ray)

  # Compute the 3D query points along each ray
  query_points = ray_origins.unsqueeze(-2).to(device) + ray_directions.unsqueeze(-2).to(device) * depth_values.unsqueeze(3).to(device)

  #############################  TODO 3 END  ############################
  return query_points, depth_values

