"""## TODO 4: Compute compositing weight of samples on camera ray (pre-step of volume rendering)

The expected color $C(ùê´)$ of camera ray ùê´ in the continuous space can be computed with the formula:
$$C(ùê´)=\int_{t_n}^{t_f}T(t)\sigma(ùê´(t))ùêú(ùê´(t),ùêù)dt$$
where $T(t)=\text{exp}(-\int_{t_n}^{t}\sigma(ùê´(s))ds)$ denotes the accumulated transmittance along the ray from $t_n$ to $t$, i.e., the probability that the ray doesn't hit any other particle from $t_n$ to $t$.

To numerically and differentiably estimate this continous integral, we use a discrete set of samples with the quadrature rule as follows:
$$\hat{C}(ùê´)=\sum_{i=1}^{N}T_i(1-\text{exp}(-\sigma_iŒ¥_i))ùêú_i$$
where N is the number of samples, $T_i=\text{exp}(-\sum_{j=1}^{i-1}\sigma_jŒ¥_j)$, and $Œ¥_i=t_{i+1}-t_i$ is the distance between adjacent samples. From sampled depth values $t_i, i=1,\cdots,N$, you can get distances $Œ¥_i, i=1,\cdots,N-1$, and you should append a huge number $1e9$ as the last distance $Œ¥_N$.

In the function `compute_compositing_weights` (TODO 4), your task is to compute the weight $w_i =  T_i(1-\text{exp}(-\sigma_iŒ¥_i))$ for each query point. In the next TODO (TODO 5), you will be using the computed weights $w_i$ to composite $ùêú_i$ into a pixel color ($\hat{C}(ùê´)=\sum_{i=1}^{N}w_iùêú_i$).
"""

def compute_compositing_weights(sigma, depth_values):
  r"""Differentiably renders a radiance field, given the origin of each ray in the
  "bundle", and the sampled depth values along them.

  Args:
    sigma (torch.Tensor): Volume density at each query location (X, Y, Z)
      (shape: :math:`(height, width, num_samples)`).
    depth_values (torch.Tensor): Sampled depth values along each ray
      (shape: :math:`(height, width, num_samples)`).

  Returns:
    weights (torch.Tensor): Rendered compositing weight of each sampled point
      (shape: :math:`(height, width, num_samples)`).
  """
  # helper function
  # Compute the cummulative product of the input array,
  # but excluse the current element
  # > cumprod_exclusive(torch.tensor([1,2,3,4,5]))
  # > tensor([ 1,  1,  2,  6, 24])
  def cumprod_exclusive(x):
    cumprod = torch.cumprod(x, -1)
    cumprod = torch.roll(cumprod, 1, -1)
    cumprod[..., 0] = 1.
    return cumprod

  device = depth_values.device
  weights = torch.ones_like(sigma, device=device) # placeholder
  #############################  TODO 4 BEGIN  ##########################

  # Compute the distances between adjacent samples
  deltas = torch.cat([
      depth_values[..., 1:] - depth_values[..., :-1],
      1e9 * torch.ones_like(depth_values[..., :1])
  ], dim=-1).to(sigma.device)

  # Compute the alpha values
  alpha = 1. - torch.exp(-sigma * deltas)

  # Compute the transmittance values
  T = cumprod_exclusive(1. - alpha)

  # Compute the compositing weights
  weights = T * alpha

  #############################  TODO 4 END  ##########################
  return weights

